INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 1, 190804, "カリン", 60000, 1, 0, 1, 0, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 1);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 0, 0, "", 60000, 2, 0, 2, 1, "今日の運勢は姫吉！　あらゆる運気が最大を示しています！　　　今なら「伝説の吸血鬼」をも従え、世界征服も夢じゃありません！", 1);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 0, 0, "", 60000, 3, 0, 2, 1, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 1);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 0, 0, "", 60000, 4, 0, 2, 1, "今日の運勢は姫吉！　その高い運気はまさにショーグンの如く！　その溢れる威光は人々を惹きつけ、皆の人気者間違いなしです！", 2);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 0, 0, "", 60000, 5, 0, 2, 2, "今日の運勢は大吉！　運気がどんどん高まっています！　　　　　何をやっても、最大効率で素晴らしい結果になりますよ♪", 1);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 0, 0, "", 60000, 6, 0, 2, 2, "今日の運勢は大吉！　なにをやっても上手くいって大活躍！　　　そんな素敵なあなたを見て、後ろから誰かが……クスクス♪", 1);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 0, 0, "", 60000, 7, 0, 2, 2, "今日の運勢は大吉！　運気が高く、何かに挑戦すると良い結果に！隠れた才能が引き出されそう！　目指せヒデサ……ではなく秀才！", 2);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 0, 0, "", 60000, 8, 0, 2, 3, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたいやき！　和菓子パワーで売上アップです！", 1);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 0, 0, "", 60000, 9, 0, 2, 3, "今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪", 1);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 0, 0, "", 60000, 10, 0, 2, 3, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 1);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 0, 0, "", 60000, 11, 0, 2, 3, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 1);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 0, 0, "", 60000, 12, 0, 2, 3, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかの如く、色々な事がうまくいきますよ♪", 2);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 0, 0, "", 60000, 13, 0, 2, 4, "今日の運勢は小吉！　早朝に幸運の兆しあり！　　　　　　　　　もしかしたら、優しいお姉ちゃんが起こしにきてくれますよ♪", 1);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 0, 0, "", 60000, 14, 0, 2, 4, "今日の運勢は小吉！　運気上昇中ですが、上がるまでが要注意！　ラッキーアニマルは熊！　本当の家族のように守ってくれるかも♪", 1);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 0, 0, "", 60000, 15, 0, 2, 4, "今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪", 1);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 0, 0, "", 60000, 16, 0, 2, 4, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 1);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 0, 0, "", 60000, 17, 0, 2, 4, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 2);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 2, 190804, "カリン", 60000, 18, 0, 3, 0, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 3, 190804, "カリン", 60000, 19, 7, 3, 0, "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 1, 101201, "ハツネ", 80001, 20, 1, 0, 0, "キミと出会ってもう\n1年もたつんだね！\nう～ん、いつも\n寝てばっかりだから、", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 2, 101201, "ハツネ", 80001, 21, 1, 0, 0, "少しでも\n寝る時間を減らして\nキミと一緒にいる\n時間増やしたいなぁ♪", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 1, 103801, "シオリ", 80001, 22, 1, 1, 0, "あなたと知り合ってから\nもう1年…\n時がたつのは\n早いですね", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 2, 103801, "シオリ", 80001, 23, 1, 1, 0, "来年も、\n一緒にいられたら…\nうれしいな", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 1, 103601, "キョウカ", 80001, 24, 2, 0, 0, "あなたと一緒にいるようになって、\nもう1年ですか…", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 2, 103601, "キョウカ", 80001, 25, 2, 0, 0, "最初の頃よりも、頼もしく\nなりましたね。私はどうですか？\n成長していますか？", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 1, 102001, "ミミ", 80001, 26, 2, 1, 0, "おにいちゃんとあってから、\n1年たったよ～！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 2, 102001, "ミミ", 80001, 27, 2, 1, 0, "ミミね、おにいちゃんと\nいっぱい遊べてたのしかったな～♪\nこれからもずっと\nいっしょにいてね～！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 1, 100401, "ミソギ", 80001, 28, 2, 2, 0, "にいちゃんがミソギのイタズラに\n引っかかり続けてもう1年かぁ", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 2, 100401, "ミソギ", 80001, 29, 2, 2, 0, "…これからもいっぱいミソギと\n遊んでね、にいちゃん！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 1, 101001, "マホ", 80001, 30, 3, 0, 0, "もう王子はんと会うてから\n1年ぐらいたつそうどすえ\n早いもんやなあ", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 2, 101001, "マホ", 80001, 31, 3, 0, 0, "このままやと、\nうちもあっという間に\n干からびてしまいそうどすえ\nなーんてな。うふふ", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 1, 104401, "イリヤ", 80001, 32, 3, 1, 0, "お主と会って早1年じゃな\nこれからも存分に尽くすがよい", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 2, 104401, "イリヤ", 80001, 33, 3, 1, 0, "わらわもたまには、お主の献身に\n報いてやらぬでもない♪", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 1, 101701, "カオリ", 80001, 34, 3, 2, 0, "もう、キミと出会って結構な時間が\nたつさ～。でも、私たちの旅は\nまだまだ始まったばかりさ～！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 2, 101701, "カオリ", 80001, 35, 3, 2, 0, "これからも、どうぞよろしく\nお願いするさ～！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 1, 102801, "サレン", 80001, 36, 4, 0, 0, "あんたと出会ってからもうそんなに\nたつのね～", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 2, 102801, "サレン", 80001, 37, 4, 0, 0, "あっという間だったって感じるほど\n楽しかったわ！\nこれからも一緒に頑張りましょ！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 1, 102501, "スズメ", 80001, 38, 4, 1, 0, "出会ってから1年間、ずっと\nご迷惑をかけっぱなしで、\nすみません…", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 2, 102501, "スズメ", 80001, 39, 4, 1, 0, "これからはもっと頑張りますから\n見ていてくださいね\nできれば…\n今までよりも、私の近くで♪", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 1, 104601, "タマキ", 80001, 40, 5, 0, 0, "振り返れば、今までいろんなことが\nあったにゃあ…", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 2, 104601, "タマキ", 80001, 41, 5, 0, 0, "これからも、二人でたくさんの\n思い出をがっぽり作っていく\nにゃー！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 1, 104801, "ミフユ", 80001, 42, 5, 1, 0, "キミとの師弟関係も、\nもう1年なのね…\nでもキミに教えることは、", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 2, 104801, "ミフユ", 80001, 43, 5, 1, 0, "まだまだいっぱいあるわ\nこれからも、\nしっかりついて来てね！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 1, 103201, "アキノ", 80001, 44, 6, 0, 0, "あなたさまと出会ってもう1年…", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 2, 103201, "アキノ", 80001, 45, 6, 0, 0, "光陰矢のごとし、とはまさに\nこのことですわ。…思い出は決して\nお金では買えませんわね", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 1, 103401, "ユカリ", 80001, 46, 6, 1, 0, "ダメな私を1年間も見捨てないで\nくれて、本当にありがとう", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 2, 103401, "ユカリ", 80001, 47, 6, 1, 0, "情けないところいっぱいみせるかも\nしれないけど、これからも一緒に\nいてくれると、うれしいな", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 1, 107101, "クリスティーナ", 80001, 48, 7, 0, 0, "オマエと出会ってもう1年か\nまさかこのワタシの結婚相手に\nなろうとはな…", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 2, 107101, "クリスティーナ", 80001, 49, 7, 0, 0, "ともかくこれからも\n愉しませてくれよ☆", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 1, 104701, "ジュン", 80001, 50, 7, 1, 0, "君と出会ってからもう1年か。\n以前と比べて私の表情もいくらか\n柔らかくなった気がするんだが、\nどうだろう？", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 2, 104701, "ジュン", 80001, 51, 7, 1, 0, "見えないから分からないって？\nそれもそうだな…", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 1, 103701, "トモ", 80001, 52, 8, 0, 0, "もう1年たったみたいだね\nあなたをからかってばかりだった\nけど、楽しかった♪", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 2, 103701, "トモ", 80001, 53, 8, 0, 0, "これからもよろしくね！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 1, 100501, "マツリ", 80001, 54, 8, 1, 0, "出会って、もう1年たっちゃった\nんスね。なんだか意外ッス", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 2, 100501, "マツリ", 80001, 55, 8, 1, 0, "毎日楽しくて、あっという間に過ぎ\nちゃったみたいなんスよね\nこれからも一緒に悪と戦うッス！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 1, 100701, "ミヤコ", 80001, 56, 9, 0, 0, "オマエと会って1年なの！\n全然成仏もできなかったし、", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 2, 100701, "ミヤコ", 80001, 57, 9, 0, 0, "生き返りもしなかったけど、\nすごく楽しかったの～♪\nオマエとプリンがあれば、\nミヤコはハッピーなの～♪", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 1, 103101, "シノブ", 80001, 58, 9, 1, 0, "あなたと出会って1年なんですね\nでも、私の占いでは、私とあなたは", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 2, 103101, "シノブ", 80001, 59, 9, 1, 0, "来年も再来年も一緒にいるようです\nふふ、よろしくお願いしますね", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 1, 100901, "アンナ", 80001, 60, 10, 0, 0, "貴様が閃光のシグルドとして覚醒し\nもう1年か…。これからも我らの\n長き戦いに終わりはないが、", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 2, 100901, "アンナ", 80001, 61, 10, 0, 0, "それでも貴様となら…\n添い遂げる覚悟はできているぞ！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 1, 101301, "ナナカ", 80001, 62, 10, 1, 0, "君と出会ってもう1年だって！\n早いねー！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 2, 101301, "ナナカ", 80001, 63, 10, 1, 0, "これからも最強のバディタッグで\n大活躍だー！\n頼りにしてるよ、相棒！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 1, 105101, "ミツキ", 80001, 64, 11, 0, 0, "1年たつのって、あっという間ね\nまだまだ君の知らない部分が\nたくさんあるし…", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 2, 105101, "ミツキ", 80001, 65, 11, 0, 0, "これからも、いろんなところを\n調べさせてね？", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 1, 105601, "ルカ", 80001, 66, 11, 1, 0, "お前さんと出会ってもう1年か\n助太刀するつもりが", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 2, 105601, "ルカ", 80001, 67, 11, 1, 0, "逆に助けられたりもしたね\nこれからもよろしく頼むよ！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 1, 102701, "エリコ", 80001, 68, 11, 2, 0, "早いものですわね、あなた様と\nお会いして、もう1年…", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 2, 102701, "エリコ", 80001, 69, 11, 2, 0, "あなた様といると、時があっと\nいう間に過ぎてしまいます\n時間を止める研究をしなくては\nいけませんね…", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 1, 102301, "アヤネ", 80001, 70, 12, 0, 0, "お兄ちゃんと会ってから、もう、\n1年なんだね。私、少しは\nお姉ちゃんっぽくなったかな？", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 2, 102301, "アヤネ", 80001, 71, 12, 0, 0, "あ、ぷうきちもお兄ちゃんっぽく\nなったよね？", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 1, 104201, "チカ", 80001, 72, 12, 1, 0, "あなたと出会って、\nもう1年がたったんですね…\nこれからもそばにいて、", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 2, 104201, "チカ", 80001, 73, 12, 1, 0, "私のことを見守ってください\nできることなら、ずっと…", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 1, 102101, "クルミ", 80001, 74, 12, 2, 0, "お兄ちゃんと出会って1年かぁ\n私、相変わらずダメダメで…", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 2, 102101, "クルミ", 80001, 75, 12, 2, 0, "で、でもこれからもずっと…\n一緒にいたいなぁ…", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 1, 104901, "シズル", 80001, 76, 13, 0, 0, "再会してちょうど1年だね\nお祝いにごちそう作ってきたよ～♪\n特製ケーキと、お寿司と、", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 2, 104901, "シズル", 80001, 77, 13, 0, 0, "ハンバーグと、カレーと、\nシチューと、あ、隠しきれない隠し\n味は、お姉ちゃんの愛情だよ！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 1, 101101, "リノ", 80001, 78, 13, 1, 0, "お兄ちゃんと再会して、もう1年\nなんですね。\n会えなかった時を思うと、", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 2, 101101, "リノ", 80001, 79, 13, 1, 0, "信じられないくらい幸せな1年\nでした！もう絶対、私から離れ\nないでくださいね♪", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 1, 100201, "ユイ", 80001, 80, 14, 0, 0, "騎士クンと出会ってから今まで、\nいろんなことがあったよね\n楽しいこと、ドキドキしたこと…", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 2, 100201, "ユイ", 80001, 81, 14, 0, 0, "そんな日々をこれからも、\nず、ずっと一緒に…\n過ごしていきたいな…！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 1, 100101, "ヒヨリ", 80001, 82, 14, 1, 0, "騎士くんと出会って、まだ1年しか\nたってないんだ！？", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 2, 100101, "ヒヨリ", 80001, 83, 14, 1, 0, "なんかもうずっと一緒にいる気が\nするなぁ…えへへ。これからの\n1年もまたよろしくねっ！\n騎士くん！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 1, 100301, "レイ", 80001, 84, 14, 2, 0, "初めてキミに出会って1年…\n随分見違えたね私もキミも、\n更に強くなっていく…", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 2, 100301, "レイ", 80001, 85, 14, 2, 0, "キミに背中を預けられる日が、\n早くきますように", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 1, 105801, "ペコリーヌ", 80001, 86, 15, 0, 0, "1年もわたしのことを、忘れない\nでいてくれて、ありがとうござい\nます！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 2, 105801, "ペコリーヌ", 80001, 87, 15, 0, 0, "これからもずっと、覚えていて\nくださいね！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 1, 105901, "コッコロ", 80001, 88, 15, 1, 0, "こうして1年も、主さまのおそばに\n置いていただけて、とても光栄\nです。どうかこれからも、", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 2, 105901, "コッコロ", 80001, 89, 15, 1, 0, "末永く主さまをお世話させて\nください。わたくしは、ずっと\n主さまのガイド役でいたいのです", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 1, 106001, "キャル", 80001, 90, 15, 2, 0, "1年か、まっさかこんなに長い\n付き合いになるなんてね～\nでも…わりと楽しい1年だったかも", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 2, 106001, "キャル", 80001, 91, 15, 2, 0, "だから、もうしばらくあんたに\n付き合ってやるわよ喜びなさい！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 1, 112101, "スズメ", 60001, 92, 0, 1, 0, "新しい年のはじめに、\nおみくじはいかがでしょうか？\nよい運勢であるほど、\n沢山プレゼントが貰えますよ♪", 1);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 0, 0, "", 60001, 93, 0, 2, 1, "今日の運勢は姫吉！　あらゆる運気が最大を示しています！　　　今なら「伝説の吸血鬼」をも従え、世界征服も夢じゃありません！", 1);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 0, 0, "", 60001, 94, 0, 2, 1, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 1);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 0, 0, "", 60001, 95, 0, 2, 1, "今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！", 1);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 0, 0, "", 60001, 96, 0, 2, 1, "今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", 1);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 0, 0, "", 60001, 97, 0, 2, 1, "今日の運勢は姫吉！　その高い運気はまさにショーグンの如く！　その溢れる威光は人々を惹きつけ、皆の人気者間違いなしです！", 2);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 0, 0, "", 60001, 98, 0, 2, 2, "今日の運勢は大吉！　運気がどんどん高まっています！　　　　　何をやっても、最大効率で素晴らしい結果になりますよ♪", 1);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 0, 0, "", 60001, 99, 0, 2, 2, "今日の運勢は大吉！　なにをやっても上手くいって大活躍！　　　そんな素敵なあなたを見て、後ろから誰かが……クスクス♪", 1);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 0, 0, "", 60001, 100, 0, 2, 2, "今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！", 1);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 0, 0, "", 60001, 101, 0, 2, 2, "今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！", 1);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 0, 0, "", 60001, 102, 0, 2, 2, "今日の運勢は大吉！　運気が高く、何かに挑戦すると良い結果に！隠れた才能が引き出されそう！　目指せヒデサ……ではなく秀才！", 2);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 0, 0, "", 60001, 103, 0, 2, 3, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたいやき！　和菓子パワーで売上アップです！", 1);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 0, 0, "", 60001, 104, 0, 2, 3, "今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪", 1);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 0, 0, "", 60001, 105, 0, 2, 3, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 1);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 0, 0, "", 60001, 106, 0, 2, 3, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 1);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 0, 0, "", 60001, 107, 0, 2, 3, "今日の運勢は中吉！　お出かけした先で良縁に恵まれそうです！　ダウナー系あざとい女子が、あま～い飴をくれるかも？", 1);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 0, 0, "", 60001, 108, 0, 2, 3, "今日の運勢は中吉！　大抵のことはゴリ押しでなんとかできます！ラッキープレイスはゲーセン。パンチングマシンでストレス発散！", 1);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 0, 0, "", 60001, 109, 0, 2, 3, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかの如く、色々な事がうまくいきますよ♪", 2);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 0, 0, "", 60001, 110, 0, 2, 4, "今日の運勢は小吉！　早朝に幸運の兆しあり！　　　　　　　　　もしかしたら、優しいお姉ちゃんが起こしにきてくれますよ♪", 1);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 0, 0, "", 60001, 111, 0, 2, 4, "今日の運勢は小吉！　運気上昇中ですが、上がるまでが要注意！　ラッキーアニマルは熊！　本当の家族のように守ってくれるかも♪", 1);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 0, 0, "", 60001, 112, 0, 2, 4, "今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪", 1);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 0, 0, "", 60001, 113, 0, 2, 4, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 1);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 0, 0, "", 60001, 114, 0, 2, 4, "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 1);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 0, 0, "", 60001, 115, 0, 2, 4, "今日の運勢は小吉！　思わぬ相手と仲良くなれるかも？　　　　　うっかり毒舌をもらしてしまわないように要注意です！", 1);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 0, 0, "", 60001, 116, 0, 2, 4, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 2);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 2, 112101, "スズメ", 60001, 117, 0, 3, 0, "おみくじの結果はいかがでしたか？\n新たに始まる一日が、\nあなたにとってよい日になりますように\n明日もお待ちしていますね♪", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 3, 112101, "スズメ", 60001, 118, 7, 3, 0, "おみくじ、楽しんで頂けましたか？\nあなたの新しい年が\n素晴らしいものになるよう、\n心からお祈りしますね", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 1, 105801, "ペコリーヌ", 80003, 119, 1, 0, 0, "ヒューヒュー♪\nドンドンパフパフー♪", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 1, 105901, "コッコロ", 80003, 120, 1, 1, 0, "ひゅーひゅー\nどんどんぱふぱふー\nでございます", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 2, 105901, "コッコロ", 80003, 121, 1, 1, 0, "さぁ、キャルさまもご一緒に\nどんどんぱふぱふいたしましょう", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 1, 106001, "キャル", 80003, 122, 1, 2, 0, "え？　ちょっと\nいきなりなにっ？", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 2, 106001, "キャル", 80003, 123, 1, 2, 0, "ドンドンパフパフってなんなの？\nあたしにも分かるように\nちゃんと説明しなさいっての！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 2, 105801, "ペコリーヌ", 80003, 124, 1, 0, 0, "実はですねキャルちゃん！\nもうすぐわたしたちにとっての\n大切な節目──", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 3, 105801, "ペコリーヌ", 80003, 125, 1, 0, 0, "『プリンセスコネクト！\nRe:Dive』\n2.5周年なんですよ！\nやばいですね☆", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 3, 105901, "コッコロ", 80003, 126, 1, 1, 0, "ですからその日に向けて\n今から気分を盛り上げているのです", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 3, 106001, "キャル", 80003, 127, 1, 2, 0, "ああ、そういえば\nそんな時期だっけ\nって言っても、もう少し先じゃない\n気が早いんじゃないの？", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 4, 105901, "コッコロ", 80003, 128, 1, 1, 0, "いいえ、キャルさま\nこういったお祝いは準備から\n楽しむものでございます\nそうですよね、ペコリーヌさま", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 4, 105801, "ペコリーヌ", 80003, 129, 1, 0, 0, "その通りです♪　というわけで！\nカウントダウンの始まりですよ！\nみんなで一緒に2.5周年に向けて\n盛り上がっていきましょー☆", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 4, 106001, "キャル", 80003, 130, 1, 2, 0, "ド、ドンドンパフパフ～\nって何言わせんのよ！\nまったくもう、浮かれちゃってさ", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 5, 105901, "コッコロ", 80003, 131, 1, 1, 0, "ふふ。キャルさまもワクワクして\nおいでのようですね\nそれでは主さま。大切な記念日まで\nどうぞご期待くださいませ", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 5, 106001, "キャル", 80003, 132, 2, 0, 0, "記念日を盛り上げるったって\n一体どうしたらいいのよ？\nあたし、そういうの\n苦手なんだけど…", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 1, 190801, "カリン", 80003, 133, 2, 1, 0, "あら、キャルさん\nどうかなさいましたか？\n何かお困りのようですけど", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 6, 106001, "キャル", 80003, 134, 2, 0, 0, "げっ…カリンじゃない\nなんでもないわよ！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 2, 190801, "カリン", 80003, 135, 2, 1, 0, "そうなのですか？\nキャルさんのことですからてっきり\n2.5周年をどう盛り上げたら\nいいか悩んでいるのかと…", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 7, 106001, "キャル", 80003, 136, 2, 0, 0, "分かってんじゃないのよ！？\nいっ、いや、違うけどね！\nあたしは別にそんなことで\n悩んでないわよっ？", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 3, 190801, "カリン", 80003, 137, 2, 1, 0, "ふふっ…\nこういう時は、真心を込めて\n気持ちをそのまま口にしたら\nいいのではないでしょうか？", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 8, 106001, "キャル", 80003, 138, 2, 0, 0, "気持ちを、ねぇ\nそれが一番難しいんじゃない…\nそもそも、あたしは記念日とか\n別にどうだっていいし", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 9, 106001, "キャル", 80003, 139, 2, 0, 0, "…まあ、ペコリーヌもコロ助も\nやけに楽しそうだったから…\nこういうお祭り騒ぎみたいなのも\nたまにはいいかな、とは思うけど", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 4, 190801, "カリン", 80003, 140, 2, 1, 0, "なるほどなるほど～\nキャルさんは【美食殿】で祝う\n2.5周年を心から楽しみに\nしている、ということですね！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 10, 106001, "キャル", 80003, 141, 2, 0, 0, "はぁ！？\nどこ聞いたらそうなるのよ！\nあたしは別に楽しみになんか…！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 5, 190801, "カリン", 80003, 142, 2, 1, 0, "キャルさんの心からの想い\nみなさんにも伝わったでしょうか？\n私も2.5周年が楽しみです！\n以上、カリンがお伝えしました！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 11, 106001, "キャル", 80003, 143, 2, 0, 0, "心からの想いって何なのよ！？\n勝手に人の言葉を\n捻じ曲げんじゃないわよ！\nこのくそ眼鏡ーーーっ！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 6, 105901, "コッコロ", 80003, 144, 3, 0, 0, "ペコリーヌさま、もうすぐ\n記念日でございますね\nこういった節目というのは\n感慨深いものでございます", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 5, 105801, "ペコリーヌ", 80003, 145, 3, 1, 0, "色んな思い出が蘇ってきますね！\n楽しい出来事が\nいっぱいありました♪", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 7, 105901, "コッコロ", 80003, 146, 3, 0, 0, "はい、そうでございますね\n主さまも【美食殿】の活動の他にも\nいろんなご経験をされたと\n聞いておりますよ", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 8, 105901, "コッコロ", 80003, 147, 3, 0, 0, "たしか…ランドソルで話題沸騰と\nなっていた、魔法少女なるものに\nお会いになられたとか", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 6, 105801, "ペコリーヌ", 80003, 148, 3, 1, 0, "魔法少女って、あの美味しくって\n栄養たっぷりの大ヒット商品\n『魔法少女ソーセージ』の箱に\n描いてある女の子のことですか！？", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 7, 105801, "ペコリーヌ", 80003, 149, 3, 1, 0, "あのソーセージ\n美味しいんですよね～♪\nわたしもたっくさん食べてますよ！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 9, 105901, "コッコロ", 80003, 150, 3, 0, 0, "あとは、牧場に素敵な温泉が\n出来たとか…", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 8, 105801, "ペコリーヌ", 80003, 151, 3, 1, 0, "牧場ですか！？　温泉につかって\nチーズもオツですね～♪　考えた\nだけでよだれが出ちゃいそうです！\nやばいですね☆", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 10, 105901, "コッコロ", 80003, 152, 3, 0, 0, "ペコリーヌさま\n言ってるそばからよだれが…\n今お拭きしますね。ふき、ふき", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 9, 105801, "ペコリーヌ", 80003, 153, 3, 1, 0, "えへへ、ありがとうございます\nコッコロちゃん！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 11, 105901, "コッコロ", 80003, 154, 3, 0, 0, "それにしても、主さまは\n【美食殿】の一員として様々な\n美食と出会われていたのですね\nわたくし、感服いたしました", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 10, 105801, "ペコリーヌ", 80003, 155, 3, 1, 0, "これからもたくさん冒険をして\nめいっぱい美食を\n味わい尽くしましょうね！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 11, 105801, "ペコリーヌ", 80003, 156, 4, 0, 0, "2.5周年カウントダウン♪\nキャルちゃんキャルちゃん！\nわくわくしますね☆", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 12, 106001, "キャル", 80003, 157, 4, 1, 0, "あぁもう、うるさいわね～\nまだまだ先でしょ？\nちょっとは落ち着きなさいよ", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 12, 105801, "ペコリーヌ", 80003, 158, 4, 0, 0, "キャルちゃんだって最近\nソワソワしてるじゃないですか～\nさっきもご機嫌そうに鼻歌とか\n歌ってましたよね？", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 13, 106001, "キャル", 80003, 159, 4, 1, 0, "なっ…！　き、聞いてたの！？\nじゃない、歌ってないわよ！？\nあんたいい加減なこと言うと\nぶっ殺すわよ！？", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 13, 105801, "ペコリーヌ", 80003, 160, 4, 0, 0, "えっへへ～♪\nわたしは最近のキャルちゃんが\nもっともっと大好きですよ♪\nすごく積極的になりましたよね！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 14, 106001, "キャル", 80003, 161, 4, 1, 0, "…積極的？\nなんの話よ？", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 14, 105801, "ペコリーヌ", 80003, 162, 4, 0, 0, "またまた～♪\nアイドルを目指そうとしたこと\n忘れちゃったんですか？", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 15, 105801, "ペコリーヌ", 80003, 163, 4, 0, 0, "ムーサの町で\nきゃるきゃる～ん☆　って！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 15, 106001, "キャル", 80003, 164, 4, 1, 0, "あっ…！？　ちちち違うわよっ！\nあれは操られてただけで\nあたしはアイドルなんか\n目指してないっての！！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 16, 105801, "ペコリーヌ", 80003, 165, 4, 0, 0, "本当に本当ですか？\nわたし、キャルちゃんとっても\n乗り気だなって\n思ってたんですけど～", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 16, 106001, "キャル", 80003, 166, 4, 1, 0, "まぁ、悪くはなかったけど…って\nだ、だから目指してないって\n言ってるでしょ！！\nなんてこと思い出させんのよ！？", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 17, 106001, "キャル", 80003, 167, 4, 1, 0, "ああ…ダメだわ…\nもう殺すしかない…\n2.5周年が来る前に\n記憶ごと消し去ってやるー！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 18, 106001, "キャル", 80003, 168, 5, 0, 0, "2.5周年まであと10日…\nふ～ん？\n案外早いもんね？", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 12, 105901, "コッコロ", 80003, 169, 5, 1, 0, "そうでございますね…\nその日のためにやるべきことは\nまだまだございます\n気を引き締めねばなりません…！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 19, 106001, "キャル", 80003, 170, 5, 0, 0, "やる気十分ねコロ助…\nそんな気負ってるとしんどいわよ？\nお気楽にやりましょ？", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 13, 105901, "コッコロ", 80003, 171, 5, 1, 0, "キャルさま…\nありがとうございます\nキャルさまは本当に\n優しいおかたです", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 20, 106001, "キャル", 80003, 172, 5, 0, 0, "な、なにわけの分かんないこと\n言ってんのよ…\nあたしは優しくなんかないっての", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 14, 105901, "コッコロ", 80003, 173, 5, 1, 0, "そんなことはございません\n…あの、実はわたくし\nキャルさまに\nひとつお願いがございまして", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 21, 106001, "キャル", 80003, 174, 5, 0, 0, "お願い？　珍しいわね\nコロ助がそんなこと言うなんて\n…まあ、あたしに出来ることなら\n別にいいけど", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 15, 105901, "コッコロ", 80003, 175, 5, 1, 0, "ありがとうございます\n実は記念日へ向けて\n『かくし芸』というものを\n用意してみようかと思いまして", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 22, 106001, "キャル", 80003, 176, 5, 0, 0, "かくし芸？", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 16, 105901, "コッコロ", 80003, 177, 5, 1, 0, "はい。きゃるきゃる～ん☆　を\n参考に、ころころ～ん☆　という\nご挨拶を考えてみたのですが\nポーズがうまくいかなくて…", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 23, 106001, "キャル", 80003, 178, 5, 0, 0, "～～！！　ちょっと褒められて\nいい気になって損したわ！！\nふざけんなふざけんな\nふ～ざ～け～ん～な～っ！！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 17, 105801, "ペコリーヌ", 80003, 179, 6, 0, 0, "あと９日！　もうすぐですよ♪\nえへへ、楽しみで楽しみで\nごはんが進みますね☆", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 24, 106001, "キャル", 80003, 180, 6, 2, 0, "ごはんが進みますね☆\nじゃなーい！\nいくらなんでも食べ過ぎよ！\n記念日、迎えられなくなるわよ！？", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 17, 105901, "コッコロ", 80003, 181, 6, 1, 0, "大丈夫ですよキャルさま\n食事はわたくしたちの\n歩んできた道そのもの\nなのですから", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 18, 105801, "ペコリーヌ", 80003, 182, 6, 0, 0, "さっすがコッコロちゃん\nいいことを言いますね！\nそう、わたしたち\n【美食殿】の活動目的は─", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 25, 106001, "キャル", 80003, 183, 6, 2, 0, "─みんなで楽しく食事をすること\nでしょ？\nあれだけ食べ歩いてきたんだから\n分かってるわよ", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 18, 105901, "コッコロ", 80003, 184, 6, 1, 0, "はい…そうでございますね♪\nそれにしてもわたくしたち\n本当にいろいろなものを\n食べ歩いてきましたね…", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 26, 106001, "キャル", 80003, 185, 6, 2, 0, "そうね…ほんっとうにね…\n毒まみれのニセドラゴンとか\n恐竜…は逃げられちゃったっけ\nあとワニゴ…ワニの魔物とかね", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 27, 106001, "キャル", 80003, 186, 6, 2, 0, "そして、とうとう本物の\nドラゴンまで相手に\nしちゃったのよね、あたしたちって", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 28, 106001, "キャル", 80003, 187, 6, 2, 0, "信じられない強さだったわね\nあのドラゴン…やっぱり\n作戦はしっかり立てていかないと\nダメよね", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 19, 105801, "ペコリーヌ", 80003, 188, 6, 0, 0, "えへへ…☆\nキャルちゃんが色んなことを\n覚えていてくれて\nうれしいです♪", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 19, 105901, "コッコロ", 80003, 189, 6, 1, 0, "わたくしも鮮明に覚えておりますよ\n主さまもきっと…♪", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 29, 106001, "キャル", 80003, 190, 6, 2, 0, "あったり前でしょ！\n忘れないわよ、あんな滅茶苦茶な\nものばかり食べさせられて！\n…忘れられるわけ、ないじゃない", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 30, 106001, "キャル", 80003, 191, 7, 0, 0, "ねえちょっと、ちょっと待って！？\nカリンから、2.5周年記念の\n生放送に出演してほしいって\n言われたんだけど！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 31, 106001, "キャル", 80003, 192, 7, 0, 0, "なんでそういう大事なことを\n急に言うわけ！？\nそんなの聞いてないわよ～！？", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 32, 106001, "キャル", 80003, 193, 7, 0, 0, "いっぱい人に見られちゃうのよね？\nなんであたしがそんなこと…", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 33, 106001, "キャル", 80003, 194, 7, 0, 0, "あー\nあー\n…声、これで大丈夫かしら？", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 34, 106001, "キャル", 80003, 195, 7, 0, 0, "聞き取りにくいかもしれないわね…\nもうちょっと明るい方がいいかも\nえっと…こんな感じ？", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 35, 106001, "キャル", 80003, 196, 7, 0, 0, "オイッスー☆", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 36, 106001, "キャル", 80003, 197, 7, 0, 0, "……\nいや、ないわ\nいつもどおりが一番ね、うん", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 37, 106001, "キャル", 80003, 198, 7, 0, 0, "もう、記念の生放送なんて\n超責任重大なやつじゃない…\nもしなにか失敗とかしたら…", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 38, 106001, "キャル", 80003, 199, 7, 0, 0, "ど、どど、どうしよう！？\n緊張してきちゃった…！！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 20, 105901, "コッコロ", 80003, 200, 8, 0, 0, "主さま、わたくし\nペコリーヌさまとキャルさまと共に\n2.5周年を祝う生放送に\n出演する大役を仰せつかりました", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 21, 105901, "コッコロ", 80003, 201, 8, 0, 0, "多くの方々に\n『プリンセスコネクト！\nRe:Dive』の魅力をお伝えする\n重要な役割でございます", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 22, 105901, "コッコロ", 80003, 202, 8, 0, 0, "わたくし、全身全霊をもって\n生放送に取り組みたいと\n思っております", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 23, 105901, "コッコロ", 80003, 203, 8, 0, 0, "ですが、もしかしたら\nセリフを噛んでしまったり\n段取りを間違えてしまったり\nするかもしれません…", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 24, 105901, "コッコロ", 80003, 204, 8, 0, 0, "そのようなことがないよう\n練習はしっかりしておかなくては\nまずはこちらから…", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 25, 105901, "コッコロ", 80003, 205, 8, 0, 0, "オイッスー☆", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 26, 105901, "コッコロ", 80003, 206, 8, 0, 0, "先ほどキャルさまが練習されて\nいるのをお見かけしたので\nわたくしもと思いまして…\nいかがでしょうか？", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 27, 105901, "コッコロ", 80003, 207, 8, 0, 0, "良い感じ、ですか？\n…ふふ、ありがとうございます\n主さまのあたたかいお言葉があれば\nわたくしは百人力でございます", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 28, 105901, "コッコロ", 80003, 208, 8, 0, 0, "この大役を無事に成し遂げ\n主さまに素敵な2.5周年を\n迎えていただけるよう…\nわたくし、尽力いたしますね", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 20, 105801, "ペコリーヌ", 80003, 209, 9, 0, 0, "オイッスー☆", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 21, 105801, "ペコリーヌ", 80003, 210, 9, 0, 0, "…う～ん、今のはちょっと\n違う感じがしますね\n堅苦しかったかもしれません", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 22, 105801, "ペコリーヌ", 80003, 211, 9, 0, 0, "あと６日で2.5周年ですか…", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 23, 105801, "ペコリーヌ", 80003, 212, 9, 0, 0, "この年月がオイッスーの\n歴史なんだと思うと\nじ～んとしちゃいます！\nやばいですね☆", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 24, 105801, "ペコリーヌ", 80003, 213, 9, 0, 0, "生放送で最高のオイッスー☆　を\nみなさんにお届けするために\n頑張らないと！\nそれじゃあもう一度…", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 25, 105801, "ペコリーヌ", 80003, 214, 9, 0, 0, "オイッスー☆", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 26, 105801, "ペコリーヌ", 80003, 215, 9, 0, 0, "…うう～ん、どうしてでしょう\nまだ何かが違う気がします…\nもしかしたら\nおなかが空きすぎてるとか？", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 27, 105801, "ペコリーヌ", 80003, 216, 9, 0, 0, "今さっき食べたばっかりですけど\nおなかが減っては\n良いオイッスー☆　は\n出せませんよね！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 28, 105801, "ペコリーヌ", 80003, 217, 9, 0, 0, "そうと決まれば、コッコロちゃんと\nキャルちゃんを誘って\nごはんにしましょう！\n善は急げです！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 29, 105801, "ペコリーヌ", 80003, 218, 9, 0, 0, "あ、二人が丁度いいところに！\nオイッス～☆　…ああ！！\n今の、今のですよ～♪", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 30, 105801, "ペコリーヌ", 80003, 219, 9, 0, 0, "なるほど、どんな時も\n自然体が一番ってことですね！\nこの調子で、生放送も\n頑張っちゃいます♪", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 31, 105801, "ペコリーヌ", 80003, 220, 10, 0, 0, "2.5周年まで残り５日ですが\nその前にもうすぐ生放送ですよ！\nコッコロちゃん\n準備の方はどうですか？", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 29, 105901, "コッコロ", 80003, 221, 10, 1, 0, "はい。わたくし、しっかりと\n備えてまいりました\n万事抜かりはございません", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 32, 105801, "ペコリーヌ", 80003, 222, 10, 0, 0, "おお～すごい自信を感じます…！\nいい生放送になりそうですね☆\n……あれ？　なんだかこの辺り\n揺れていませんか？", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 39, 106001, "キャル", 80003, 223, 10, 2, 0, "…………", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 30, 105901, "コッコロ", 80003, 224, 10, 1, 0, "キャルさま？\nお風邪をひかれたんでしょうか\nひどい震えですが…", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 40, 106001, "キャル", 80003, 225, 10, 2, 0, "かかかか風邪じゃないわよ！\nここここれはただ\nななな生放送が楽しみ過ぎて\nワワワワクワクが止まらないだけ！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 33, 105801, "ペコリーヌ", 80003, 226, 10, 0, 0, "大丈夫ですかキャルちゃん！？\nそうだ、これを飲んでください！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 41, 106001, "キャル", 80003, 227, 10, 2, 0, "きき気がきくじゃない、ありがとっ\nごくっ、んく…ぶはぁっ！？\nちょっと何飲ませたの！？\n辛っ！　苦ぁ！？　甘ぁっ！？", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 34, 105801, "ペコリーヌ", 80003, 228, 10, 0, 0, "これは魔物のエキスに薬草に\nその他色んなものを混ぜた\n特製の栄養ドリンクです！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 35, 105801, "ペコリーヌ", 80003, 229, 10, 0, 0, "これを飲めば体ぽかぽかで\n元気いっぱいですよ♪", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 42, 106001, "キャル", 80003, 230, 10, 2, 0, "このアホリーヌ！\n風邪じゃないって言ったでしょ！？\nどさくさに紛れて\nそんな恐ろしいもん飲ませんな～！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 31, 105901, "コッコロ", 80003, 231, 10, 1, 0, "キャルさま\n震えが収まっておりますね\nよかったです…\nわたくし、心配いたしました", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 43, 106001, "キャル", 80003, 232, 10, 2, 0, "え？　ああ、ホントね…って\nだから風邪じゃないって\n言ってるのに…\nまあいいわこの際なんでも", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 36, 105801, "ペコリーヌ", 80003, 233, 10, 0, 0, "えっへへ～♪　いつも通りの\nキャルちゃんに戻りましたし\n素敵な生放送が出来そうですね！\n今から楽しみです☆", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 6, 190801, "カリン", 80003, 234, 11, 0, 0, "ランドソルのみなさま、こんにちは\n生放送の会場設営を担当しています\n【ギルド管理協会】のカリンです", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 7, 190801, "カリン", 80003, 235, 11, 0, 0, "【美食殿】のみなさんは\nまもなく始まる生放送に向けて\n最後の調整のため\n席を外しています", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 8, 190801, "カリン", 80003, 236, 11, 0, 0, "頑張っている３人の\n邪魔をするわけには\nいきませんので、ご容赦ください", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 9, 190801, "カリン", 80003, 237, 11, 0, 0, "ですので、本日は私から\n【美食殿】のみなさんの様子を\nお伝えさせていただこうと思います", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 10, 190801, "カリン", 80003, 238, 11, 0, 0, "まずはペコリーヌさんですが…\n何やら大量のおにぎりを\n食べているようです\nえっと…栄養は大事ですよね", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 11, 190801, "カリン", 80003, 239, 11, 0, 0, "次にコッコロさんですが\nこちらは発声練習をしています", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 12, 190801, "カリン", 80003, 240, 11, 0, 0, "一生懸命、小さなお口を開けて\n声を出す姿が応援したくなりますね", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 13, 190801, "カリン", 80003, 241, 11, 0, 0, "そしてキャルさんは…\nこれは…堂々としたものですね\n何もせず、ただ立ち尽くして…", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 14, 190801, "カリン", 80003, 242, 11, 0, 0, "あれ？\nもしかして緊張で気を失って…？", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 15, 190801, "カリン", 80003, 243, 11, 0, 0, "…ええと\n【美食殿】のみなさんは\nやる気十分なようですね！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 16, 190801, "カリン", 80003, 244, 11, 0, 0, "３人とも生放送を\nいいものにしようと\n全力で頑張ってくれていますので\nどうかご期待ください", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 17, 190801, "カリン", 80003, 245, 11, 0, 0, "それでは\nまた明日お会いしましょう♪", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 44, 106001, "キャル", 80003, 246, 12, 0, 0, "2.5周年まであと３日！\nそして生放送は明日！\nなんかいよいよって感じね…", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 37, 105801, "ペコリーヌ", 80003, 247, 12, 2, 0, "３人でい～っぱい練習しましたし\nきっと大丈夫ですよ☆", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 32, 105901, "コッコロ", 80003, 248, 12, 1, 0, "ペコリーヌさまに\n大丈夫と言ってもらえると\nとても心強いですね", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 45, 106001, "キャル", 80003, 249, 12, 0, 0, "信じすぎちゃだめよコロ助\nこいつはなーんにも\n考えてないだけなんだから", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 38, 105801, "ペコリーヌ", 80003, 250, 12, 2, 0, "ひどいですよぉキャルちゃ～ん！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 33, 105901, "コッコロ", 80003, 251, 12, 1, 0, "ふふ。お二人とも\n普段通りの様子で\n安心いたしました", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 39, 105801, "ペコリーヌ", 80003, 252, 12, 2, 0, "はいっ☆\n生放送でもなんでも\n全力全開、わたしらしく\nぶつかっていくだけです！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 46, 106001, "キャル", 80003, 253, 12, 0, 0, "そうね。おめでたいことなんだし\nここまで来たんなら\n楽しめるだけ\n楽しむしかないわよね！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 34, 105901, "コッコロ", 80003, 254, 12, 1, 0, "わたくしも、普段よりも心が\n熱くなっております\nこの胸の気持ちをお伝えできるよう\n精一杯努力いたします…！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 40, 105801, "ペコリーヌ", 80003, 255, 12, 2, 0, "それでは、いきましょう！\n明日の生放送、絶対に\n成功させましょうね☆", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 41, 105801, "ペコリーヌ", 80003, 256, 13, 0, 0, "えっと、最初のひと言は…あれ？\nキャルちゃん、わたし\n何て言うんでしたっけ？", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 47, 106001, "キャル", 80003, 257, 13, 2, 0, "は！？\nなにいきなりど忘れしてるの！？\nっていうかあんた、台本は！？", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 42, 105801, "ペコリーヌ", 80003, 258, 13, 0, 0, "忘れてきちゃいました☆", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 48, 106001, "キャル", 80003, 259, 13, 2, 0, "忘れてきちゃいました☆\nで済ませられると思ってんの！？\nほら、あたし二冊持ってきたから\nこれ使いなさい！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 35, 105901, "コッコロ", 80003, 260, 13, 1, 0, "マイクとは、こんな高い位置に\nあるものなのですね…！\n背伸びをすれば、何とか…\nう～ん、うぅ～ん…！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 49, 106001, "キャル", 80003, 261, 13, 2, 0, "あぁもう\n少し下げればいいでしょ！？\nこれくらいでいい？\nまったく、世話が焼けるわね…", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 43, 105801, "ペコリーヌ", 80003, 262, 13, 0, 0, "あれ？\nキャルちゃん、後ろ髪が\nはねちゃってますよ？", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 50, 106001, "キャル", 80003, 263, 13, 2, 0, "え？　うそっ！？\nちゃんと確かめてきたのに！\nどこどこ！？", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 36, 105901, "コッコロ", 80003, 264, 13, 1, 0, "キャルさま、動かないで\nくださいまし。今くしで…\nはい、直りましたよ", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 51, 106001, "キャル", 80003, 265, 13, 2, 0, "あ、ありがと…はぁ。生放送\n本番までもうすぐなのに\nこんなことしてる場合じゃ\nないわよね", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 37, 105901, "コッコロ", 80003, 266, 13, 1, 0, "はい、時間は残りわずかです\nですが、慌ただしく\n動き回るこの時間も\nなんだか楽しくて…♪", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 52, 106001, "キャル", 80003, 267, 13, 2, 0, "コロ助、あんた…って\nそうじゃなくて！\n胸にジンワリきてる\n暇なんかないでしょ…！？", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 44, 105801, "ペコリーヌ", 80003, 268, 13, 0, 0, "あはは♪\nキャルちゃんの動きが\nとっても面白いです♪\nやばいですね☆", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 38, 105901, "コッコロ", 80003, 269, 13, 1, 0, "ふふ\nきっと面白い生放送になると\nわたくし、確信しております", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 45, 105801, "ペコリーヌ", 80003, 270, 13, 0, 0, "絶対絶対、間違いありません！\n見てくれるみなさんが\n笑顔になれる時間を\nお届けしましょう！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 53, 106001, "キャル", 80003, 271, 13, 2, 0, "そんなの当然でしょ！\n誰が見たって面白いって\n言ってもらえるように\nあれだけ準備したんだから！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 46, 105801, "ペコリーヌ", 80003, 272, 13, 0, 0, "それでは\n記念日直前生放送！\n楽しみにしててくださいね☆", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 18, 190801, "カリン", 80003, 273, 14, 0, 0, "こんにちは\n【ギルド管理協会】のカリンです", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 19, 190801, "カリン", 80003, 274, 14, 0, 0, "昨日の生放送は\nいかがだったでしょうか？", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 20, 190801, "カリン", 80003, 275, 14, 0, 0, "たくさんの笑顔と喜びと\nそして驚きを受け取って\nいただけたのではないかと思います", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 21, 190801, "カリン", 80003, 276, 14, 0, 0, "そしていよいよ\n明日は2.5周年の当日\n待ちに待った記念日を\n迎えることとなります", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 22, 190801, "カリン", 80003, 277, 14, 0, 0, "【美食殿】のみなさんも\n張り切って様々な準備を\nされていますよ", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 23, 190801, "カリン", 80003, 278, 14, 0, 0, "【ギルド管理協会】も\n万全のサポート体制で\n協力してまいりたいと思います", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 24, 190801, "カリン", 80003, 279, 14, 0, 0, "…ふふ、本当に楽しみですね\n【ギルド管理協会】の職員として\nだけではなく、私個人としても…", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 25, 190801, "カリン", 80003, 280, 14, 0, 0, "この記念日を迎えられることが\n心から楽しみですし\n幸せを感じています", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 26, 190801, "カリン", 80003, 281, 14, 0, 0, "きっと【美食殿】のみなさんは\nそれ以上に心を弾ませて\nいることでしょう", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 27, 190801, "カリン", 80003, 282, 14, 0, 0, "それでは\n明日からの2.5周年を\nどうぞ、お楽しみに…♪", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 47, 105801, "ペコリーヌ", 80003, 283, 15, 0, 0, "準備はいいですかっ？\n…いっきますよー！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 54, 106001, "キャル", 80003, 284, 15, 2, 0, "祝！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 39, 105901, "コッコロ", 80003, 285, 15, 1, 0, "2.5周年！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 48, 105801, "ペコリーヌ", 80003, 286, 15, 0, 0, "おめでとうございま～す☆", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 55, 106001, "キャル", 80003, 287, 15, 2, 0, "少し前まではまだまだ先じゃない\nとか言ってたけど\n本当にあっという間だったわね", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 40, 105901, "コッコロ", 80003, 288, 15, 1, 0, "光陰矢の如し…\nとはこのことでございますね\nでも、今日という日を無事に\n迎えることができて良かったです", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 49, 105801, "ペコリーヌ", 80003, 289, 15, 0, 0, "コッコロちゃん！　キャルちゃん！\n落ち着くには\nまだ早いですよ！\n盛り上がるのはこれからです☆", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 56, 106001, "キャル", 80003, 290, 15, 2, 0, "ほんとあんたはいつも\n全力全開ねー\nでもそうね、記念日なんだし\nパーっといきましょ！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 41, 105901, "コッコロ", 80003, 291, 15, 1, 0, "ええ、わたくしも全力全開で\nまいります…！\n主さま、さあ\nどうぞ手を取ってくださいまし…♪", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 57, 106001, "キャル", 80003, 292, 15, 2, 0, "あんたもコロ助も、浮かれて\n転ぶんじゃないわよ？\n…仕方ないから、あたしも\n手を繋いであげるわよ", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 50, 105801, "ペコリーヌ", 80003, 293, 15, 0, 0, "あー！　二人ともずるいです！\nわたしもっ、ギュー♪", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 58, 106001, "キャル", 80003, 294, 15, 2, 0, "ちょっ、ペコリーヌ！\nくっつき過ぎよ！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 51, 105801, "ペコリーヌ", 80003, 295, 15, 0, 0, "記念日だから\n平気平気♪\nやばいですね☆", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 59, 106001, "キャル", 80003, 296, 15, 2, 0, "意味分かんないわよ！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 42, 105901, "コッコロ", 80003, 297, 15, 1, 0, "ふふ。このめでたき日に\n喜びがあふれておりますね\n主さまは…いかがでしょうか？", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 43, 105901, "コッコロ", 80003, 298, 15, 1, 0, "喜んでいただけているならば\nわたくしはとてもとても\n幸せでございます", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 52, 105801, "ペコリーヌ", 80003, 299, 15, 0, 0, "さぁ、2.5周年を\n楽しみ尽くしますよ☆\nまだまだ食べたいものもありますし\nやりたいこともたくさんです！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 60, 106001, "キャル", 80003, 300, 15, 2, 0, "分かった、分かったから\n引っ張るんじゃないわよ！\n…そんな掴まなくても\nちゃんとついていくから", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 44, 105901, "コッコロ", 80003, 301, 15, 1, 0, "ペコリーヌさま…キャルさま…\n主さま…共にまいりましょう\nどこまでも…！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 53, 105801, "ペコリーヌ", 80003, 302, 15, 0, 0, "はい！　それでは2.5周年\n食べつくしツアーへ！\nそして、その先の未来へ\n向かって出発しましょう！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (1, "105901,45,106001,61", 54, 105801, "ペコリーヌ・コッコロ・キャル", 80003, 303, 15, 0, 0, "2.5周年\nありがとうございます！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 1, 190804, "カリン", 60002, 304, 0, 1, 0, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 1);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 0, 0, "", 60002, 305, 0, 2, 1, "今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！", 1);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 0, 0, "", 60002, 306, 0, 2, 1, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 1);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 0, 0, "", 60002, 307, 0, 2, 1, "今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！", 1);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 0, 0, "", 60002, 308, 0, 2, 1, "今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", 1);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 0, 0, "", 60002, 309, 0, 2, 1, "今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", 2);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 0, 0, "", 60002, 310, 0, 2, 2, "今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？", 1);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 0, 0, "", 60002, 311, 0, 2, 2, "今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", 1);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 0, 0, "", 60002, 312, 0, 2, 2, "今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！", 1);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 0, 0, "", 60002, 313, 0, 2, 2, "今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！", 1);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 0, 0, "", 60002, 314, 0, 2, 2, "今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", 2);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 0, 0, "", 60002, 315, 0, 2, 3, "今日の運勢は中吉！　家の中でゆっくり過ごすのがよさそう！　　ラッキーアイテムはゲームよ！　ベストスコアを更新できるかも？", 1);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 0, 0, "", 60002, 316, 0, 2, 3, "今日の運勢は中吉！　上手くなりたいことに積極的に挑戦してみてサックス好きの妹が、手取り足取りサポートしてくれるかも～？", 1);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 0, 0, "", 60002, 317, 0, 2, 3, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 1);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 0, 0, "", 60002, 318, 0, 2, 3, "今日の運勢は中吉！　日頃の努力が報われます！　　　　　　　　親しい友人がいるなら報告してみて。一緒に喜んでくれるはずだ。", 1);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 0, 0, "", 60002, 319, 0, 2, 3, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたい焼き！　和菓子パワーで売上アップです！", 1);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 0, 0, "", 60002, 320, 0, 2, 3, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 1);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 0, 0, "", 60002, 321, 0, 2, 3, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかのごとく、色々な事がうまくいきますよ♪", 2);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 0, 0, "", 60002, 322, 0, 2, 4, "今日の運勢は小吉！　まだ見ぬ危険が隠れているかも！　　　　　でも安心しろ！　提督が貴公を守ってくれるはずだぞ！", 1);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 0, 0, "", 60002, 323, 0, 2, 4, "今日の運勢は小吉！　いろんな事件が起こる一日になりそう！　　状況をよく観察してみようじゃないか！　まさに探偵のごとくね！", 1);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 0, 0, "", 60002, 324, 0, 2, 4, "今日の運勢は小吉！　気の向くままに過ごすのが幸せへの近道！　美味い魚を食べて猫を眺めて、自然体で過ごすのはどうだい？", 1);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 0, 0, "", 60002, 325, 0, 2, 4, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 1);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 0, 0, "", 60002, 326, 0, 2, 4, "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 1);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 0, 0, "", 60002, 327, 0, 2, 4, "今日の運勢は小吉！　周りに流されず、マイペースな一日を！　　ただし寝すぎには注意ぐうたらし過ぎず適度な運動を、だってさ～", 1);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 0, 0, "", 60002, 328, 0, 2, 4, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 2);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 2, 190804, "カリン", 60002, 329, 0, 3, 0, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 3, 190804, "カリン", 60002, 330, 7, 3, 0, "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 1, 105901, "コッコロ", 80005, 331, 1, 4, 0, "ささ、シェフィさまはこちらへ…", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 1, 106401, "シェフィ", 80005, 332, 1, 0, 0, "コッコロさん、どこへ行くの…？\n…え？", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 1, 105801, "ペコリーヌ", 80005, 333, 1, 3, 0, "『おめでとうございます！\nわ～パチパチー！』\n…という感じでどうですかね！？", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 2, 105901, "コッコロ", 80005, 334, 1, 4, 0, "ではわたくしも\n後ろからクラッカーを鳴らして\n応戦いたします\nああ、当日が待ち遠しいですね", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 2, 106401, "シェフィ", 80005, 335, 1, 0, 0, "ええと…\n二人とも何をしているの？", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 1, 106001, "キャル", 80005, 336, 1, 1, 0, "シェフィは初めてだもんね\nあの日が近いからって\n予行練習してんのよ\n気が早いわよね～", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 3, 106401, "シェフィ", 80005, 337, 1, 0, 0, "あの日…？", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 2, 105801, "ペコリーヌ", 80005, 338, 1, 3, 0, "その通りです…\nいよいよ記念すべきあの日が\n近づいてきましたよ！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 3, 105801, "ペコリーヌ", 80005, 339, 1, 3, 0, "『プリンセスコネクト！\nRe:Dive』3.5周年！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 1, 190801, "カリン", 80005, 340, 1, 2, 0, "やばいですね☆", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 2, 106001, "キャル", 80005, 341, 1, 1, 0, "って、なにしれっと\n参加してんのよカリン！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 2, 190801, "カリン", 80005, 342, 1, 2, 0, "ふふ、いいじゃないですか\n【ギルド管理協会】として\n私もみなさんと一緒に\nお祝いをさせてください！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 3, 190801, "カリン", 80005, 343, 1, 2, 0, "それに…記念日が近づけば\nとっておきの情報を\nお届けしますから♪", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 4, 105801, "ペコリーヌ", 80005, 344, 1, 3, 0, "というわけで\n今日からシェフィちゃんも一緒に\nカウントダウンしちゃいましょう！\n3.5周年まで…", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 4, 106401, "シェフィ", 80005, 345, 1, 0, 0, "えっ！？　ええとええと…！\nあ、あと14日…！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 5, 105801, "ペコリーヌ", 80005, 346, 2, 3, 0, "3.5周年まであと13日\n豪華に、そして盛大に\nお祝いしたいですね☆", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 3, 105901, "コッコロ", 80005, 347, 2, 1, 0, "豪華といえば前にとある貴族さまが\n舞踏会を開かれたそうで\n主さまがそのお手伝いを\nしておりました", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 4, 105901, "コッコロ", 80005, 348, 2, 1, 0, "そこで美しい所作を学ばれたので\nわたくしも教えていただきました\nしゃなり、しゃなり…\nいかがでしょう？", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 6, 105801, "ペコリーヌ", 80005, 349, 2, 3, 0, "すっごく上手ですよ☆\nまるでお姫様みたいです\nせっかくなのでわたしも\nしゃなりしゃなり", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 5, 105901, "コッコロ", 80005, 350, 2, 1, 0, "さすがでございます\nペコリーヌさま", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 3, 106001, "キャル", 80005, 351, 2, 0, 0, "いや、あんたは\nできなきゃダメでしょ\n本物のお姫様なんだし", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 5, 106401, "シェフィ", 80005, 352, 2, 2, 0, "しゃなり、しゃなり…\nふふ、案外できるものね", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 7, 105801, "ペコリーヌ", 80005, 353, 2, 3, 0, "わぁ！\nシェフィちゃん\n姿勢がとってもキレイです♪", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 6, 105901, "コッコロ", 80005, 354, 2, 1, 0, "さ、次はキャルさまの\n番でございますよ", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 4, 106001, "キャル", 80005, 355, 2, 0, 0, "あ、あたしはいいわよ！\nそういうの全然分かんないし…", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 6, 106401, "シェフィ", 80005, 356, 2, 2, 0, "大丈夫\nやってみると結構楽しいわよ\nほらほらっ", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 5, 106001, "キャル", 80005, 357, 2, 0, 0, "そ、そこまで言うなら…\nしゃなにゅわきゃあっ！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 6, 106001, "キャル", 80005, 358, 2, 0, 0, "いたたた…もぉお～！\nなんであたしがこんな目に～！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 7, 105901, "コッコロ", 80005, 359, 2, 1, 0, "まぁまぁ\n記念日までに練習すれば\nできるようになるかもしれません\nよろしければお教えいたしますよ", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 7, 106001, "キャル", 80005, 360, 2, 0, 0, "よし！\nあんたたちができて\nあたしだけできないのはしゃくだし\nやってやろうじゃないの！！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 8, 105901, "コッコロ", 80005, 361, 3, 1, 0, "3.5周年まであと12日\n記念日当日はもちろんですが\nその日を待つ時間というのも\n心躍ります", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 8, 105801, "ペコリーヌ", 80005, 362, 3, 3, 0, "分かりますっ！\nどんな特別な料理を食べられるのか\n考えるだけでワクワクしますよね！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 9, 105901, "コッコロ", 80005, 363, 3, 1, 0, "特別な料理といえば、お祭りですね\nそういえば主さまは学生として\n聖学祭に参加されたこと\nがあるとか…", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 7, 106401, "シェフィ", 80005, 364, 3, 2, 0, "聖学祭…って、なにかしら？", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 10, 105901, "コッコロ", 80005, 365, 3, 1, 0, "聖テレサ女学院の祭典ですよ\n二つのチームが競い合い\n青春を満喫するのが趣旨のようです", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 8, 106001, "キャル", 80005, 366, 3, 0, 0, "それってカルミナの\nサプライズライブがあった\nお祭りよね？\nちょっと見たかったかも…", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 9, 106001, "キャル", 80005, 367, 3, 0, 0, "カルミナの後の\nライブも好評だったらしいじゃない\n確か、なかよし部\nだったっけ…？", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 9, 105801, "ペコリーヌ", 80005, 368, 3, 3, 0, "なかよし部…\n仲が良さそうな名前で\nやばいですね☆", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 10, 106001, "キャル", 80005, 369, 3, 0, 0, "いや、そのまんますぎでしょ…", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 8, 106401, "シェフィ", 80005, 370, 3, 2, 0, "聖学祭かぁ…なんだか楽しそうね\nそれになかよし部の人たちも\n気になるわ", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 10, 105801, "ペコリーヌ", 80005, 371, 3, 3, 0, "それじゃあわたしたちも、\n負けじと仲良くしましょう♪\nほらほらシェフィちゃん、\nぎゅーっ☆　ですよ♪", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 9, 106401, "シェフィ", 80005, 372, 3, 2, 0, "えっ？　ええ…\nぎゅーっ…？", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 11, 106001, "キャル", 80005, 373, 4, 0, 0, "3.5周年まであと11日！？\nお祝いの準備進んでないんだけど…\nああ～昨日に戻りたいわ…", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 10, 106401, "シェフィ", 80005, 374, 4, 2, 0, "そういえばそんな魔道具があるって\n聞いたことがあるわね\n確か、名前はタイムラーベ…", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 12, 106001, "キャル", 80005, 375, 4, 0, 0, "なにそれヤバいわね\nでも本当にあるんだったら\n準備よりももっとやり直したいこと\nたくさんあるんだけど…", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 11, 105901, "コッコロ", 80005, 376, 4, 1, 0, "もしや正月の件でしょうか…？\nあの時はお金がなくて\n苦労しましたから", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 13, 106001, "キャル", 80005, 377, 4, 0, 0, "あれはそうね…\nお金を湯水のように使う\nぺコリーヌを止められたら\nあんな苦労をすることもなかったし", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 11, 105801, "ペコリーヌ", 80005, 378, 4, 3, 0, "そんなこともありましたね！\nやり直したいといえば\n『きゃるきゃる～ん♪』\nの方かと思いましたよ！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 14, 106001, "キャル", 80005, 379, 4, 0, 0, "バラすんじゃないわよ\nこのアホリーヌ！\nシェフィはそれ\n知らないんだから！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 15, 106001, "キャル", 80005, 380, 4, 0, 0, "こうなったらもう、なんとか\nタイムラーべを探し出して\n今の会話をなかったことに…\nって、どうしたのよシェフィ", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 11, 106401, "シェフィ", 80005, 381, 4, 2, 0, "うん…もし、私だったら…\n私が知らないみんなとの時間を\n見てみたいな、って…", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 12, 105801, "ペコリーヌ", 80005, 382, 4, 3, 0, "シェフィちゃん！　タイムなんとか\nなんかなくても大丈夫ですよ！\n一緒の時間はこれから\nどんどん作ればいいんですから！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 12, 105901, "コッコロ", 80005, 383, 4, 1, 0, "はい、今この瞬間も\n未来にはかけがえのない思い出に\nなっていることでしょう", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 16, 106001, "キャル", 80005, 384, 4, 0, 0, "だからそんな顔しないの\nほら、お祝いの準備、進めるわよ！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 12, 106401, "シェフィ", 80005, 385, 4, 2, 0, "みんな…そうね\n最高のお祝いにして\n最高の思い出にしましょう！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 13, 105801, "ペコリーヌ", 80005, 386, 5, 3, 0, "3.5周年まで、あと10日！\nもうすぐですよー！\n楽しみすぎて、やばいですね！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 14, 105801, "ペコリーヌ", 80005, 387, 5, 3, 0, "そういえば…たくさんのおもちゃが\n子どもたちを襲うっていう\n騒動もありましたね…\nなんでも勝手に動き出したとか！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 15, 105801, "ペコリーヌ", 80005, 388, 5, 3, 0, "学校や孤児院とかに\nちっちゃなおもちゃが乗り込んで\n暴れたみたいですよ！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 17, 106001, "キャル", 80005, 389, 5, 0, 0, "暴れたって言っても\n所詮はおもちゃじゃない\nどうせちっさいんでしょ？", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 18, 106001, "キャル", 80005, 390, 5, 0, 0, "だったら魔法で\n全部ぶっ飛ばせばいいじゃない！\n大したことないわよ！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 13, 106401, "シェフィ", 80005, 391, 5, 2, 0, "キャルってば…\n相手は子どもが\n大事にしてる物なのよ…？", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 13, 105901, "コッコロ", 80005, 392, 5, 1, 0, "乱暴な発言は\nめっ、でございますよ？\n子どもの教育に悪影響を\n与えてしまいますから…", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 16, 105801, "ペコリーヌ", 80005, 393, 5, 3, 0, "キャルちゃんだって\n意外と猫グッズとか\nたっくさん集めてますよね？\nもしその子たちが暴れたら…？", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 19, 106001, "キャル", 80005, 394, 5, 0, 0, "う、うっさいわね！\n意外とか言うな！\n…ま、まあ確かに正面切って\n魔法でぶっ飛ばせないかもね…", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 17, 105801, "ペコリーヌ", 80005, 395, 5, 3, 0, "あはは☆\nキャルちゃんのそういうところ\n好きですよ♪", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 18, 105801, "ペコリーヌ", 80005, 396, 5, 3, 0, "そんなキャルちゃんに猫グッズを\nプレゼントしちゃいますね！\n一部で流行っていた、たい焼き屋の\nおまけフィギュアですよ♪", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 19, 105801, "ペコリーヌ", 80005, 397, 5, 3, 0, "乱暴に扱ったりしないでくださいね\nひとりでに暴れ出しちゃうかも\nしれませんから！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 4, 190801, "カリン", 80005, 398, 6, 2, 0, "3.5周年まであと９日\nここでみなさんに\nビックニュースですよ！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 5, 190801, "カリン", 80005, 399, 6, 2, 0, "3.5周年を祝う生放送に\n去年と同様【美食殿】の\nみなさんにご出演いただくことが\n決定しましたー！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 20, 106001, "キャル", 80005, 400, 6, 1, 0, "…えっ！？", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 20, 105801, "ペコリーヌ", 80005, 401, 6, 3, 0, "本当ですか！？\nそれじゃ今から張り切って\n生放送中に食べる魔物料理を\n作らなくちゃですね☆", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 14, 106401, "シェフィ", 80005, 402, 6, 0, 0, "いや…がんばるところは\nそこじゃないような…\nというか去年も出演してたのね\nすごいじゃない！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 14, 105901, "コッコロ", 80005, 403, 6, 4, 0, "はい。とても緊張しますが\nやりがいのある大役です\n一緒にがんばりましょうね\nシェフィさま", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 15, 106401, "シェフィ", 80005, 404, 6, 0, 0, "わ、私も出るの！？　でも…\n私も【美食殿】の一人だものね\nそれなら今からしっかり準備をして\nコンディションを整えないと…", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 21, 106001, "キャル", 80005, 405, 6, 1, 0, "ふふん♪\n生放送直前のカチコチになった\nシェフィの姿が楽しみだわ！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 21, 105801, "ペコリーヌ", 80005, 406, 6, 3, 0, "去年のキャルちゃんは\n緊張しすぎてずっと震えて\nかわいかったですもんね！\n今年もあの姿が見たいです！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 22, 106001, "キャル", 80005, 407, 6, 1, 0, "ぶっ殺すぞ！？", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 6, 190801, "カリン", 80005, 408, 6, 2, 0, "というわけで\n『プリンセスコネクト！\nRe:Dive』の魅力を\nお伝えする生放送をお楽しみに♪", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 15, 105901, "コッコロ", 80005, 409, 7, 1, 0, "3.5周年まであと８日\nでございますよ\n楽しみですね、主さま", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 23, 106001, "キャル", 80005, 410, 7, 0, 0, "そういえばあんた\n夏休みの宿題は\nきちんとやってるの？", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 16, 106401, "シェフィ", 80005, 411, 7, 2, 0, "宿題…学校に通うのも\n楽しいことばかりじゃ\nないのね", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 22, 105801, "ペコリーヌ", 80005, 412, 7, 3, 0, "あれ？　そういえば\n少し前にルーセント学院で\n何かあったような…", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 24, 106001, "キャル", 80005, 413, 7, 0, 0, "ああ、始業式の日に\n大捕り物があったって\n話題になってたわね", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 17, 106401, "シェフィ", 80005, 414, 7, 2, 0, "夏休みを終わらせないって\n騒いでたっていう話？\nあれ本当なの？\n都市伝説だと思ってたわ", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 16, 105901, "コッコロ", 80005, 415, 7, 1, 0, "その一件ならよく存じ上げて\nおります。ですから主さま\n次の機会にはわたくしと一緒に\nがんばりましょう", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 18, 106401, "シェフィ", 80005, 416, 7, 2, 0, "楽しそう…私も一緒にやりたいな\nママ…じゃ、じゃなくて！\nコッコロさん、私もまざっていい？", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 17, 105901, "コッコロ", 80005, 417, 7, 1, 0, "もちろんでございます\n仲良くお勉強いたしましょう", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 25, 106001, "キャル", 80005, 418, 7, 0, 0, "しれっと教育ママが\n生まれてる…？", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 23, 105801, "ペコリーヌ", 80005, 419, 7, 3, 0, "お勉強は大切ですよ！\nキャルちゃんも一緒に\nがんばりましょう！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 26, 106001, "キャル", 80005, 420, 7, 0, 0, "え～～～～！？", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 27, 106001, "キャル", 80005, 421, 8, 0, 0, "3.5周年まであと７日〜♪\nふふ～ん♪\nふんふふ～ん♪", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 19, 106401, "シェフィ", 80005, 422, 8, 2, 0, "…\nねぇコッコロさん\nキャル、どうしちゃったの？", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 18, 105901, "コッコロ", 80005, 423, 8, 1, 0, "とてもご機嫌そうに\n鼻歌を歌ってらっしゃいますね\n耳も尻尾もリズミカルに\n揺れて…ノリノリでございます", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 24, 105801, "ペコリーヌ", 80005, 424, 8, 3, 0, "あれはですね！\nカルミナのみなさんの\nサマーライブのチケットが\n手に入ったからなんですよ♪", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 20, 106401, "シェフィ", 80005, 425, 8, 2, 0, "ええっ！？\nあのライブのチケットって確か\n入手困難だったんじゃ…", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 28, 106001, "キャル", 80005, 426, 8, 0, 0, "ふふふふ～ん♪\nしゃいにんぐふゅ～ちゃ～♪", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 19, 105901, "コッコロ", 80005, 427, 8, 1, 0, "なるほど…\nキャルさまがあのように\nなってしまうのも頷けますね", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 21, 106401, "シェフィ", 80005, 428, 8, 2, 0, "…カルミナの\n『Shining Future』\nの中に、シャイニングフューチャー\nって歌詞はなかったはずだけど…", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 29, 106001, "キャル", 80005, 429, 8, 0, 0, "ふんふ…はっ！？\nあっ、あんたたち！\nなに人の鼻歌を\n勝手に聞いてるのよ！？", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 30, 106001, "キャル", 80005, 430, 8, 0, 0, "こっ、これは別に\nカルミナの曲じゃなくて…\nあたしのオリジナルソングよ！\n聞いたらお金取るわよっ！？", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 25, 105801, "ペコリーヌ", 80005, 431, 8, 3, 0, "えへへ、キャルちゃん\nカルミナのサマーライブ\n思いっきり楽しみましょうね☆", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 31, 106001, "キャル", 80005, 432, 8, 0, 0, "も～っ！\n生暖かい目で見るな～～！\nぶっ殺すわよ～～～！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 22, 106401, "シェフィ", 80005, 433, 9, 0, 0, "3.5周年まであと６日\n３人も言ってたけど\nあっという間だったわね", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 23, 106401, "シェフィ", 80005, 434, 9, 0, 0, "…えっ？\n生放送の意気込み！？\n突然なに！？", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 24, 106401, "シェフィ", 80005, 435, 9, 0, 0, "ええと…\nとにかく失敗しないように\n台本たくさん読んで…\nそれから…", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 25, 106401, "シェフィ", 80005, 436, 9, 0, 0, "えっ！？\nトラブルがあったら\nどうするのかって！？\nそ、それは…！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 26, 106401, "シェフィ", 80005, 437, 9, 0, 0, "とにかく落ち着いて\nスタッフさんの指示を聞いて…", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 27, 106401, "シェフィ", 80005, 438, 9, 0, 0, "それから、それから…！\nぅ、ぅぅっ…！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 28, 106401, "シェフィ", 80005, 439, 9, 0, 0, "―びえぇぇ～んっ！！！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 20, 105901, "コッコロ", 80005, 440, 9, 1, 0, "どうされましたか、シェフィさま", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 29, 106401, "シェフィ", 80005, 441, 9, 0, 0, "ううっ…ひっく…\nママッ…！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 21, 105901, "コッコロ", 80005, 442, 9, 1, 0, "よしよし、緊張されてるのですね\nママが傍におりますよ\n主さま、少々お待ちくださいませ", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 22, 105901, "コッコロ", 80005, 443, 9, 1, 0, "…ふぅ\nシェフィさま\n生放送への意気込み\nお話しできそうですか？", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 30, 106401, "シェフィ", 80005, 444, 9, 0, 0, "…ううっ\n恥ずかしすぎて\nもう生放送出られない…", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 23, 105901, "コッコロ", 80005, 445, 10, 0, 0, "主さま\n3.5周年まであと５日\nでございます", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 24, 105901, "コッコロ", 80005, 446, 10, 0, 0, "ですがその前に\n生放送がありますね", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 25, 105901, "コッコロ", 80005, 447, 10, 0, 0, "…生放送に向けた\n意気込みでございますか？", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 26, 105901, "コッコロ", 80005, 448, 10, 0, 0, "もちろんわたくしは\n主さまのために\n全身全霊を込めて\n楽しい時間をご提供いたします", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 27, 105901, "コッコロ", 80005, 449, 10, 0, 0, "…と、意気込んでみましたが\nうまくできるか少し不安です\n声が小さくなったり\n間違えてしまったらどうしようと…", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 28, 105901, "コッコロ", 80005, 450, 10, 0, 0, "ですがわたくしは\n一人ではありません\n【美食殿】のみなさまが\nおります", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 29, 105901, "コッコロ", 80005, 451, 10, 0, 0, "どんな困難も\nみなさまと一緒なら\n乗り越えられると\nわたくし、確信しております", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 30, 105901, "コッコロ", 80005, 452, 10, 0, 0, "それに今回はシェフィさまも\nご参加されるわけですし\nママとしてお手本に\nならねばなりませんね", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 31, 105901, "コッコロ", 80005, 453, 10, 0, 0, "主さま。3.5周年も\n食卓を囲んでいる時のような\n楽しい思い出を\n一緒に作りましょうね", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 26, 105801, "ペコリーヌ", 80005, 454, 11, 0, 0, "3.5周年まであと４日！\nやばいですね☆", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 32, 106001, "キャル", 80005, 455, 11, 1, 0, "はいはい、やばいわね\nというかもうすぐ生放送だけど\nあんた準備はできてるの？", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 27, 105801, "ペコリーヌ", 80005, 456, 11, 0, 0, "ばっちりオイッスー☆　ですよ！\n『王家の装備』も全開です！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 28, 105801, "ペコリーヌ", 80005, 457, 11, 0, 0, "あとは前回を超える\n最高のオイッスー☆　を\nお届けできるように\n練習あるのみですかね！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 29, 105801, "ペコリーヌ", 80005, 458, 11, 0, 0, "キャルちゃんは\nどうなんですか？\nオイッスー☆　を\n毎日ちゃんと練習してますか？", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 33, 106001, "キャル", 80005, 459, 11, 1, 0, "はぁ！？　なんであたしまで\nその変なあいさつを練習しないと\nいけないのよ！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 30, 105801, "ペコリーヌ", 80005, 460, 11, 0, 0, "もしかしてやってないんですか？\nダメですよキャルちゃん！\nシェフィちゃんだってちゃんと\n毎日練習してるのに！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 31, 105801, "ペコリーヌ", 80005, 461, 11, 0, 0, "こうなったらわたしがキャルちゃん\nにオイッスー☆　の『オ』から\nしっかり教えてあげないと！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 32, 105801, "ペコリーヌ", 80005, 462, 11, 0, 0, "オイッスー☆　の『オ』は\n口を大きく開いて〜\nドラゴンの骨つき肉に\nかぶりつく直前をイメージして〜", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 34, 106001, "キャル", 80005, 463, 11, 1, 0, "だからあたしはやるなんて一言も…", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 33, 105801, "ペコリーヌ", 80005, 464, 11, 0, 0, "オイッスー☆", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 35, 106001, "キャル", 80005, 465, 11, 1, 0, "聞きなさいっての！！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 31, 106401, "シェフィ", 80005, 466, 12, 2, 0, "3.5周年まであと３日…\nそして生放送は、明日…", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 32, 106401, "シェフィ", 80005, 467, 12, 2, 0, "もっと台本を\n読み込んでおかないと…\nあと発声練習も…", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 33, 106401, "シェフィ", 80005, 468, 12, 2, 0, "おいっす！\n…こうじゃなかったわね\nええと確か…", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 34, 106401, "シェフィ", 80005, 469, 12, 2, 0, "うう…あんなに練習したのに\nこれじゃみんなに迷惑かけちゃう…", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 35, 106401, "シェフィ", 80005, 470, 12, 2, 0, "【美食殿】の一員として\n認められるように\n頑張らないといけないのに\nよし、もう一度…", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 34, 105801, "ペコリーヌ", 80005, 471, 12, 3, 0, "やってますねシェフィちゃん！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 36, 106001, "キャル", 80005, 472, 12, 0, 0, "なによ、考えることは\nみんな同じってこと？", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 32, 105901, "コッコロ", 80005, 473, 12, 1, 0, "ふふ。シェフィさま\nよろしければ\n仲間に入れてください\n一緒にやればきっとうまくできます", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 36, 106401, "シェフィ", 80005, 474, 12, 2, 0, "みんな…もちろんよ！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 35, 105801, "ペコリーヌ", 80005, 475, 12, 3, 0, "それじゃ明日の生放送に向けて\n一緒に練習がんばりましょう☆", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 7, 190801, "カリン", 80005, 476, 13, 2, 0, "3.5周年まであと２日と\n迫った本日は…\nいよいよ生放送です！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 8, 190801, "カリン", 80005, 477, 13, 2, 0, "【美食殿】のみなさんが\n準備に入られていますので\nそれぞれ繋いでみましょう！\nまずはペコリーヌさんです！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 36, 105801, "ペコリーヌ", 80005, 478, 13, 3, 0, "今日もオイッスー☆\nみんなで一緒に\nオイッスー☆", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 9, 190801, "カリン", 80005, 479, 13, 2, 0, "お手本になるような\n発声練習ですね！\nそれでは続いてコッコロさん", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 33, 105901, "コッコロ", 80005, 480, 13, 4, 0, "はじめちょろちょろ\nなかぱっぱ～♪\n生放送前にみなさまで\n食卓を囲んで英気を養いましょう", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 10, 190801, "カリン", 80005, 481, 13, 2, 0, "さすが【美食殿】のママですね！\nそしてキャルさんは…", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 37, 106001, "キャル", 80005, 482, 13, 1, 0, "大丈夫…大丈夫…\nあたしは大丈夫…", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 11, 190801, "カリン", 80005, 483, 13, 2, 0, "す、すごく震えてますけど\n大丈夫でしょうか…？\nそして今回初参加となる\n期待の新人シェフィさん！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 37, 106401, "シェフィ", 80005, 484, 13, 0, 0, "あうー？", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (1, "105901,34,106001,38,190801,12", 37, 105801, "みんな", 80005, 485, 13, 4, 0, "あ…", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 39, 106001, "キャル", 80005, 486, 13, 1, 0, "ちょ、ちょっとシェフィ！？\nなに赤ちゃん返りしてん―\nあ痛ぁっ！\n噛んだわこいつーっ！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 35, 105901, "コッコロ", 80005, 487, 13, 4, 0, "シェフィさま\n緊張しすぎて\nしまったのでしょうね…\nおーよしよし…", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 38, 105801, "ペコリーヌ", 80005, 488, 13, 3, 0, "シェフィちゃん！\nそういう時は手のひらに\n好きな文字を書いて\n食べちゃうといいですよ！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 13, 190801, "カリン", 80005, 489, 13, 2, 0, "…ええと、現場からは以上です！\n生放送はもうすぐ！\n特別なお知らせもありますので\nどうぞお楽しみに！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 38, 106401, "シェフィ", 80005, 490, 14, 2, 0, "3.5周年の記念日も\nいよいよ明日ね\n…って、あれ？", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 39, 105801, "ペコリーヌ", 80005, 491, 14, 3, 0, "記念日はこの森へ行きませんか！？\nすっごく美味しいお肉が\nとれるんです☆", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 40, 106001, "キャル", 80005, 492, 14, 0, 0, "うげ、またあの魔物？\nさすがに今度は\n丸焼きとかはやめてよね…\n見た目がヤバすぎるし", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 36, 105901, "コッコロ", 80005, 493, 14, 1, 0, "ふふ、キャルさまもだいぶ\n魔物肉に慣れてきたようですね\n調理ならばわたくしに\nお任せください♪", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 39, 106401, "シェフィ", 80005, 494, 14, 2, 0, "みんな、何をしているの？\nなんだか、\n不穏な単語が聞こえたんだけど…", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 40, 105801, "ペコリーヌ", 80005, 495, 14, 3, 0, "シェフィちゃん！\n明日の食べ尽くしツアーの\n相談をしてたんですよ！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 37, 105901, "コッコロ", 80005, 496, 14, 1, 0, "はい。明日は【美食殿】の\n一員となったシェフィさまと一緒に\n初めて記念日を過ごすのですから\n特別なコース料理を用意しませんと", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 41, 106001, "キャル", 80005, 497, 14, 0, 0, "ふふん♪\n猫の毛も逆立つような\nあれこれを食べさせられるから\n覚悟しておいたほうがいいわよ？", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 40, 106401, "シェフィ", 80005, 498, 14, 2, 0, "へ、へぇ…", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 41, 105801, "ペコリーヌ", 80005, 499, 14, 3, 0, "期待しててくださいね！\nシェフィちゃんとあなたに\n『おいちー！』って喜んでもらえる\n最高のごちそうを準備しますから☆", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 41, 106401, "シェフィ", 80005, 500, 14, 2, 0, "ええと…その…うーんと…\nわ、分かったわ\n私も【美食殿】の一員だもの", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 42, 106401, "シェフィ", 80005, 501, 14, 2, 0, "それにあなたも一緒みたいだし\n最後までがんばってみるわ…！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 42, 105801, "ペコリーヌ", 80005, 502, 15, 3, 0, "それではいつものあれを\nやりましょう！\n準備はいいですかっ？\n…いっきますよー！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 42, 106001, "キャル", 80005, 503, 15, 1, 0, "祝！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 38, 105901, "コッコロ", 80005, 504, 15, 4, 0, "3.5周年！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 43, 106401, "シェフィ", 80005, 505, 15, 0, 0, "おめでとうございます！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 14, 190801, "カリン", 80005, 506, 15, 2, 0, "この日を迎えられたのも\nあなたが『プリンセスコネクト！\nRe:Dive』を遊んでくれている\nおかげです！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 15, 190801, "カリン", 80005, 507, 15, 2, 0, "ということで\nみなさんからあなたへ一言ずつ\n感謝の言葉をどうぞ！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 43, 105801, "ペコリーヌ", 80005, 508, 15, 3, 0, "感謝の言葉ですか？　わたしは\n毎日あなたに感謝してますよ\n【美食殿】の仲間になってくれて…\n一緒にごはんを食べてくれて…", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 44, 105801, "ペコリーヌ", 80005, 509, 15, 3, 0, "なにより今でもわたしをぺコリーヌ\nって呼んでくれてありがとうござい\nます。これからもわたしはあなたの\nぺコリーヌです！　やばいですね☆", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 43, 106001, "キャル", 80005, 510, 15, 1, 0, "えっ！？　今度はあたし！？\n感謝って…まぁ、そうね…\nあんたにはあたしが\n辛くて苦しい時に助けてもらって…", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 44, 106001, "キャル", 80005, 511, 15, 1, 0, "でもおかげで色々吹っ切れたわ！\nもしあんたが困ってたら今度は\nあたしが助けてあげるから\nその時はちゃんと言いなさいよ！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 44, 106401, "シェフィ", 80005, 512, 15, 0, 0, "ええと…次は私ね\n実はよく覚えてないのだけど\n空から落ちてきた私を受け止めて\nくれたのはあなたなのでしょう？", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 45, 106401, "シェフィ", 80005, 513, 15, 0, 0, "最初に私を見つけてくれたのが\nあなたで良かったって思ってるの\nおかげで私は居場所を見つけたから\nあなたがくれたもの、大切にするわ", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 39, 105901, "コッコロ", 80005, 514, 15, 4, 0, "では最後にわたくしから…\nわたくしは主さまの元を離れた日…\nこのように記念日をお祝いする\nことは二度とないと思っていました", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 40, 105901, "コッコロ", 80005, 515, 15, 4, 0, "ですが、主さまはわたくしを\n迎えにきてくださり、今もこうして\nおそばにおいてくださっています\nわたくしにとって毎日が記念日です", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 41, 105901, "コッコロ", 80005, 516, 15, 4, 0, "わたくしたちの物語は\nまだ続いていきます\nこれからも一緒にページを\n作っていきましょうね", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 45, 105801, "ペコリーヌ", 80005, 517, 15, 3, 0, "それじゃ\nいつものあれでしめますよ！\nみんなで一緒に、さんはい☆", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (1, "105901,42,106001,45,106401,46,190801,16", 46, 105801, "みんな", 80005, 518, 15, 4, 0, "これからも\nよろしくおねがいします！", 0);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 1, 190804, "カリン", 60003, 519, 0, 1, 0, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 1);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 0, 0, "", 60003, 520, 0, 2, 1, "今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！", 1);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 0, 0, "", 60003, 521, 0, 2, 1, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 1);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 0, 0, "", 60003, 522, 0, 2, 1, "今日の運勢は姫吉！　羽が生えたように飛躍できる絶好調の運気！新しいことに挑戦するなら今しかないわ！　やってみましょう！", 1);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 0, 0, "", 60003, 523, 0, 2, 1, "今日の運勢は姫吉！　精霊も新年の幸福をお祝いしています！　　主さまの笑顔が見られて、わたくしも幸せいっぱいでございます♪", 1);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (0, "", 0, 0, "", 60003, 524, 0, 2, 1, "今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", 2);
